    def initiate_plot(self, input_dict):

        ###Example dictionary###
        """NBO_dict = {'AuCl2_CSD-YAZTUP-02-b': ['104.56', 71.05],
            'AuCl2_CSD-RELQEG-02-b': ['109.44', 55.86],
            'AuCl2_CSD-WANROW-02-a': ['110.46', 57.07],
            'AuCl2_CSD-KIGFOW-02-a': ['106.15', 49.11],
            'AuCl2_CSD-TOGJIK-02-b': ['91.50', 71.72],
            'AuCl2_CSD-UZITUT-02-a': ['100.10', 46.160000000000004]}"""
        for keys, values in input_dict.items():
            self.x_axis_list.append(float(values[0]))
            self.y_axis_list.append(float(values[1]))
            self.Name.append(keys)

        return self.x_axis_list, self.y_axis_list

    def Get_point(self, x_pos, y_pos):
        smallest_distance = None
        dist_list = []
        for i, j, name in zip(self.x_axis_list, self.y_axis_list, self.Name):
            a = numpy.array((i, j))
            b = numpy.array((x_pos, y_pos))
            dist = numpy.linalg.norm(a - b)
            if smallest_distance is None:
                smallest_distance = dist
            if dist < smallest_distance:
                smallest_distance = dist
            else:
                pass
            dist_list.append(dist)
        print("#####################")
        print(f"{x_pos, y_pos}")
        print("shortes_distance" + str(smallest_distance))
        print(self.Name[dist_list.index(smallest_distance)])
        print(f"This is where the coords should be {NBO_dict[self.Name[dist_list.index(smallest_distance)]]}")
        print("#####################")
        self.DialogBox.addItem("   ############")
        self.DialogBox.addItem(f"Complex Name: {self.Name[dist_list.index(smallest_distance)]}")
        self.DialogBox.addItem(f"NBO dict: {NBO_dict[self.Name[dist_list.index(smallest_distance)]]}")
        self.DialogBox.addItem("   ############")
        self.DialogBox.addItem(" ")


